import { Component } from 'react';
import Link from 'next/link'

class FirstPost extends Component {
    constructor(props)
    {
        super(props);
        this.state = {};
    }

    render = () => {
        return (
            <>
                <h1>First Post</h1>
                <h2>
                    <Link href="/">
                        <a>Back to home</a>
                    </Link>
                </h2>
            </>
        )
    };
}

export default FirstPost;
